import MainContent from './componenst/MainContent';
import data from './componenst/data';
import './App.css';


function App() {

  const sisu = data.map(item => {
    return (
      <div>
        {item.name}
        {item.age}
        {item.birthday}
        {item.img}
      </div>


    );
  });


  return (
    <div className="App">
      {sisu}

    </div>
  );
}

export default App;
